"use strict";var app=new Vue({data:{ready:!1,posts:[]},methods:{click:function(n){var t=n.target.id.replace("post-","");location.href="/"+t}}});$(document).ready(function(){var n=Number(location.hash.replace("#",""));n=Object.is(n,NaN)||n<=0?"":String(n);console.log(n);$.get("/api/archive/"+n,function(n){app.posts=n.posts;app.$mount("#archives");app.ready=!0})})